// src/pages/RequestAccess.js
import React, { useState } from "react";
import Section from "../components/UI/Section";
import SectionDivider from "../components/UI/SectionDivider";
import { useAuth } from "../context/AuthContext";

const RequestAccess = () => {
  const { setOriginalDueDate, setGender } = useAuth();
  const [parent1, setParent1] = useState("");
  const [parent2, setParent2] = useState("");
  const [email, setEmail] = useState("");
  const [due, setDue] = useState("");
  const [selGender, setSelGender] = useState("");
  const [message, setMessage] = useState("");
  const [submitting, setSubmitting] = useState(false);

  const requestAccess = async (e) => {
    e.preventDefault();
    if (submitting) return;
    setSubmitting(true);
    const subject = encodeURIComponent("Access Request: Taylor-Made Baby Planning");
    const combinedName = parent2 ? `${parent1} & ${parent2}` : parent1;
    const body = encodeURIComponent(
      `Parent 1: ${parent1}\nParent 2: ${parent2}\nCombined: ${combinedName}\nEmail: ${email}\nDue date: ${due}\nGender: ${selGender || 'unspecified'}\n\nMessage:\n${message}`
    );
    if (due) {
      try {
        const iso = new Date(due).toISOString();
        setOriginalDueDate(iso);
      } catch {}
    }
    if (selGender) setGender(selGender);
    try {
      await fetch('/api/users', {
        method: 'POST', headers: { 'Content-Type': 'application/json' },
        credentials: 'include',
        body: JSON.stringify({
          parent1,
          parent2,
          email,
          dueDate: due || '',
          originalDueDate: due || '',
          gender: selGender,
          status: 'requested',
        }),
      });
    } catch {}
    window.location.href = `mailto:RegistrywithTaylor@gmail.com?subject=${subject}&body=${body}`;
    setSubmitting(false);
  };

  return (
    <div className="min-h-screen bg-white">
      <SectionDivider className="pt-4" />
      <Section title="Request Access" center tightTop compact>
        <div className="max-w-3xl mx-auto text-black/70 mb-6">
          <p className="leading-relaxed">
            Taylor‑Made is invite‑only to protect client privacy. Share a few basics and I’ll follow up with an invite.
          </p>
        </div>
        <div className="max-w-3xl mx-auto cc-card text-left">
          <h3 className="font-serif text-xl text-black mb-4">Tell me about your family</h3>
          <form onSubmit={requestAccess} className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="col-span-1">
              <label className="block text-black font-medium mb-1">Parent 1 Name</label>
              <input
                type="text"
                value={parent1}
                onChange={(e) => setParent1(e.target.value)}
                placeholder="First parent name"
                className="w-full rounded-lg border-2 border-gold/40 focus:border-gold px-4 py-3 bg-white"
                required
              />
            </div>
            <div className="col-span-1">
              <label className="block text-black font-medium mb-1">Parent 2 Name (optional)</label>
              <input
                type="text"
                value={parent2}
                onChange={(e) => setParent2(e.target.value)}
                placeholder="Second parent name"
                className="w-full rounded-lg border-2 border-gold/40 focus:border-gold px-4 py-3 bg-white"
              />
            </div>
            <div className="md:col-span-2">
              <label className="block text-black font-medium mb-1">Email</label>
              <input
                type="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                placeholder="you@example.com"
                className="w-full rounded-lg border-2 border-gold/40 focus:border-gold px-4 py-3 bg-white"
                required
              />
            </div>
            <div className="col-span-1">
              <label className="block text-black font-medium mb-1">Due Date (optional)</label>
              <input
                type="date"
                value={due}
                onChange={(e) => setDue(e.target.value)}
                className="w-full rounded-lg border-2 border-gold/40 focus:border-gold px-4 py-3 bg-white"
              />
            </div>
            <div className="col-span-1">
              <label className="block text-black font-medium mb-1">Baby's Gender (optional)</label>
              <select
                value={selGender}
                onChange={(e) => setSelGender(e.target.value)}
                className="w-full rounded-lg border-2 border-gold/40 focus:border-gold px-4 py-3 bg-white"
              >
                <option value="">Prefer not to say</option>
                <option value="girl">Girl</option>
                <option value="boy">Boy</option>
              </select>
            </div>
            <div className="md:col-span-2">
              <label className="block text-black font-medium mb-1">Message</label>
              <textarea
                value={message}
                onChange={(e) => setMessage(e.target.value)}
                rows="5"
                placeholder="Tell me a bit about your needs, timeline, and priorities…"
                className="w-full rounded-lg border-2 border-gold/40 focus:border-gold px-4 py-3 bg-white"
              />
              <p className="mt-2 text-sm text-black/60">I typically respond within 1–2 business days.</p>
            </div>
            <div className="md:col-span-2 flex flex-wrap gap-3 items-center">
              <button type="submit" disabled={submitting} className="btn btn-primary">
                {submitting ? 'Preparing email…' : 'Request Access'}
              </button>
              <span className="text-sm text-black/60">This will open your email client with details pre‑filled.</span>
            </div>
          </form>
        </div>
      </Section>
    </div>
  );
};

export default RequestAccess;
